import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

// 这个file就是为了验证db有没有connect好：
export default function AllJobs() {
    const [allJobs, setAllJobs] = useState([]);

    function findallJobs() {
        axios.get('/api/jobs/findAll')
            .then(response => {
                setAllJobs(response.data)
            })
            .catch(error => console.error(error));
    }

    console.log(setAllJobs);
    useEffect(findallJobs, []);

    const jobListComponent = allJobs.map(job => {
        return (<>
        <p></p>
        <Link to={"/api/jobs/" + job.title}>{job.title}</Link>
        </>)
    });

    return (
        <div>
            <h1>These are all the jobs: </h1>
            {jobListComponent}
        </div>
    )
}
